import React, { useEffect, useState } from 'react'
import { useSelector } from 'react-redux'
import { videoService } from '../services/videoService'

export function Home() {
    const [favorites, setFavorites] = useState([])
    useEffect(() => {
        loadFavoritesList()
    }, [])

    async function loadFavoritesList() {
        const favoList = await videoService.queryFavorites()
        console.log('favoList is:', favoList);
        setFavorites(favoList)
    }
    return (
        <section className="home-page">
            <h1>Welcome Amit </h1>
            <div>
                <h2>Favorite list for you</h2>
                {favorites.list?.map((data, idx) => {
                    return <h1 key={idx}>{data.list[0].snippet.title}</h1>
                })}
            </div>
        </section>
    )
}
